    (7431,'Pride & Prejudice (2009)','It is a truth universally acknowledged, that a single man in possession of a good fortune must be in want of a wife&#133; Tailored from the adored Jane Austen classic, Marvel Comics is proud to present PRIDE AND PREJUDICE! Two-time Rita Award-Winner Nancy Butler and fan-favorite Hugo Petrus faithfully adapt the whimsical tale of Lizzy Bennet and her loveable-if-eccentric family, as they navigate through tricky British social circles. Will Lizzy''s father manage to marry off her five daughters, despite his wife''s incessant nagging... And will Lizzy''s beautiful sister Jane marry the handsome, wealthy Mr. Bingley, or will his brooding friend Mr. Darcy stand between their happiness... "This project has been like a dream come true for me as a writer and as a former graphic designer-not only am I adapting a book I love, I am doing it in the one forum, comics, where words and pictures carry equal weight." Nancy Butler, two-time RITA winner and multiple RT Reviewer''s Choice winner in Regency.','http://gateway.marvel.com/v1/public/series/7431',2009,2009,'RATED T',NULL,'2011-05-31T17:10:52-0400','http://i.annihil.us/u/prod/marvel/i/mg/9/b0/4bb52c8a6299e/jpg'),
